import React from 'react'
import ModalLearn from './ModalLearn'


function ModalClickLearn() {
const navigate = useNavigate()

  return (
    <div>
        <ModalLearn navigate={navigate}></ModalLearn>
    </div>
  )
}

export default ModalClickLearn
